import { Row, Col, Card } from 'antd'
import React from 'react'

export default function Home() {
  return (
    <div>
      <Row>
        <Col span={24} align="left">
          <Card title="Note Maker" cover="data:image/png;base64,"></Card>
        </Col>
      </Row>
      </div>
  )
}
